import { Component, OnInit } from '@angular/core';
import { SharedDataService } from '../../../shared-data.service';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
@Component({
  selector: 'app-profile',
  templateUrl: './profile.component.html',
  styleUrls: ['./profile.component.css']
})
export class ProfileComponent implements OnInit{

  constructor(private sharedData : SharedDataService,private formBuilder: FormBuilder){}
  profileForm: FormGroup;

  ngOnInit(): void {
    this.profileForm = this.formBuilder.group({
      firstName: ['', Validators.required],
      lastName: [''],
      email: ['', [Validators.required, Validators.email]],
      address: [''],
      department: [''],
      gender: [''],
      skills: [''],
      phone: ['']
    });

  }

  get f() { return this.profileForm.controls; }

  onSubmit() {
    if (this.profileForm.invalid) {
      return;
    }

    console.log(this.profileForm.value);
  }

}
<div class="container">
  <form [formGroup]="profileForm" (ngSubmit)="onSubmit()">
    <div class="form-container">
      <div class="name-content">
        <label>FirstName</label>
        <input type="text" formControlName="firstName" placeholder="First Name">
        <small *ngIf="f['firstName'].invalid && (f['firstName'].dirty || f['firstName'].touched)" class="error-message">
          <small *ngIf="f['firstName'].invalid">First Name is required</small>
        </small>
        <div class="name-text">
        <label>LastName</label>
        <input type="text" formControlName="lastName" placeholder="Last Name">
        </div>
      </div> 

      <div class="name-content1">
        <label>Email:</label>
        <input type="email" formControlName="email" placeholder="Email">
        <small *ngIf="f['email'].invalid && (f['email'].dirty || f['email'].touched)" class="error-message">
          <small *ngIf="f['email'].invalid">Email is required</small>
        </small>

        <label for="department">Department:</label>
        <input type="text" id="department" formControlName="department">
      </div>

      <div class="name-content2">
        <label for="gender">Gender:</label>
        <select id="gender" formControlName="gender">
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>

        <label for="skills">Skills:</label>
        <input type="text" id="skills" formControlName="skills">

        <label for="phoneNumber">Phone Number:</label>
        <input type="text" id="phoneNumber" formControlName="phoneNumber">
      </div>  
    </div>
    <button type="submit" [disabled]="profileForm.invalid">Save</button>
  </form>
</div>
